import React from "react";
import { useHistory } from "react-router-dom";
const Detail = (props) => {
  const history = useHistory();

  return (
    <div>
      <h2>단어 추가하기</h2>
      <form>
        <div>
          <label>단어</label>
          <input type="text"></input>
        </div>
        <div>
          <label>설명</label>
          <input type="text"></input>
        </div>
        <div>
          <label>예시</label>
          <input type="text"></input>
        </div>
        <button
          onClick={() => {
            history.push("/");
          }}
        >
          추가하기
        </button>
      </form>
    </div>
  );
};

export default Detail;
